DROP VIEW IF EXISTS `cantidad_ausente`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `cantidad_ausente` AS select  COUNT(id_cita) as ausentes  from citas inner JOIN fechas on citas.id_fecha = fechas.id_fecha where citas.estado = 1 and fechas.fecha=(select CURDATE()) ;

