-- ----------------------------
-- View structure for cupos_dias
-- ----------------------------
DROP VIEW IF EXISTS `cupos_dias`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `cupos_dias` AS SELECT fechas.id_fecha,fechas.fecha, SUM(fechas.numero_cupos) as numero_cupos_asignados ,fechas.nombre_festivo 
FROM fechas WHERE estado=1
GROUP BY fechas.fecha ;

-- ----------------------------
-- View structure for cupos_disponibles
-- ----------------------------
DROP VIEW IF EXISTS `cupos_disponibles`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `cupos_disponibles` AS SELECT (fechas2.numero_cupos_asignados-COUNT(citas.id_cita)) as cupos_disponibles FROM citas RIGHT JOIN cupos_dias as fechas2 ON fechas2.id_fecha=citas.id_fecha WHERE fechas2.fecha=CURDATE() ;

