-- ----------------------------
-- Procedure structure for asignacion_feriado
-- ----------------------------
DROP PROCEDURE IF EXISTS `asignacion_feriado`;
delimiter ;;
CREATE PROCEDURE `asignacion_feriado`(fecha1 date, nombre varchar(50))
begin

DECLARE done BOOLEAN DEFAULT FALSE; #Variable utilizada como bandera para la finalizacion del la iteracion del cursor
DECLARE bandera int;
DECLARE id_horario1 VARCHAR(30); #Variable utilizada como tenmporal en el fecth de la consulta 
DECLARE estado1 INT; #Variable utilizada como temporal en el fecth de la consulta
DECLARE numero_cupos1 int; #Variable utilizada como temporal en el fecth de la consulta
DECLARE tipo_horario1 VARCHAR(12); #Variable utilizada como temporal en el fetch de la consulta
DECLARE horario1 VARCHAR(30);
DECLARE c1 CURSOR FOR SELECT id_horarios,numero_cupos,horario,estado,tipo_horario FROM horarios where tipo_horario='FIN SEMANA'; #WHERE estado=1;  Asignacion de valor al cursor


DECLARE CONTINUE HANDLER FOR NOT FOUND SET done =TRUE;#Declaracion de Handler para la salida del cursor

#Establece la fecha como la primera fecha 

 #Se ejecutara mientras que la fecha que se esta iterando sea menor a la fecha final

 #Convierte la fecha a numero de dia de la semana

							/*Ingreso de los dias de semana*/
							OPEN c1;
								c1_loop: LOOP
						
								FETCH c1 INTO id_horario1,  numero_cupos1, horario1,estado1, tipo_horario1;
									
									IF `done` THEN 
									LEAVE c1_loop; 
									END IF;
																															
			update  fechas set numero_cupos=numero_cupos1,estado=estado1, festivo_estado=1, nombre_festivo=nombre, tipo_horario='FIN SEMANA' where  					fecha= fecha1 and horario=horario1;
								
																				
							END LOOP c1_loop;
							
							
							
							
							CLOSE c1;

							






set bandera =1;
select bandera;





end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for asignacion_horarios_default
-- ----------------------------
DROP PROCEDURE IF EXISTS `asignacion_horarios_default`;
delimiter ;;
CREATE PROCEDURE `asignacion_horarios_default`(a date,b date)
BEGIN

DECLARE done BOOLEAN DEFAULT FALSE; #Variable utilizada como bandera para la finalizacion del la iteracion del cursor
DECLARE bandera int;
DECLARE pid_horarios VARCHAR(30); #Variable utilizada como tenmporal en el fecth de la consulta 
DECLARE pnumero_cupos INT; #Variable utilizada como temporal en el fecth de la consulta
DECLARE phorario VARCHAR(30); #Variable utilizada como temporal en el fecth de la consulta
DECLARE pestado INT; #Variable utilizada como temporal en el fecth de la consulta
DECLARE ptipo_horario VARCHAR(12); #Variable utilizada como temporal en el fetch de la consulta

DECLARE fecha DATE; #Variable que guardara la fecha que se utilizara para la condicion del while
DECLARE ndia INT; #Variable que guardara el numero de dia de la semana que corresponde a la fecha que se esta iterando
DECLARE nid INT;  #Variable que guardara el id generado para el nuevo registro de la tabla fechas
DECLARE c1 CURSOR FOR SELECT id_horarios,numero_cupos,horario,estado,tipo_horario FROM horarios; #WHERE estado=1;  Asignacion de valor al cursor




DECLARE CONTINUE HANDLER FOR NOT FOUND SET done =TRUE;#Declaracion de Handler para la salida del cursor

SET fecha=a; #Establece la fecha como la primera fecha 


WHILE fecha<=b DO #Se ejecutara mientras que la fecha que se esta iterando sea menor a la fecha final

SET ndia=DAYOFWEEK(fecha); #Convierte la fecha a numero de dia de la semana

							/*Ingreso de los dias de semana*/
							OPEN c1;
								c1_loop: LOOP
						
								FETCH c1 INTO pid_horarios,pnumero_cupos,phorario,pestado,ptipo_horario;
									
									IF `done` THEN 
									LEAVE c1_loop; 
									END IF;
				
										IF(ndia=7)THEN	#Si el dia e sabado(1) o domingo(7)
													IF(ptipo_horario='FIN SEMANA')THEN	#Si el horario es fin de semana																													
															##############################################################################################
														
															SELECT MAX(id_fecha)+1,fecha,pnumero_cupos,phorario,pestado,ptipo_horario FROM fechas;
															#############################################################################################
													END IF;
													
											ELSEIF(ndia>1 AND ndia<=6)THEN #Si no es dia de semana

													IF(ptipo_horario='SEMANA')THEN	 #Si el horario es de dia de semana																
																														##############################################################################################
																											
															SELECT MAX(id_fecha)+1,fecha,pnumero_cupos,phorario,pestado,ptipo_horario FROM fechas;
															#############################################################################################
													END IF;
										END IF;
																
							END LOOP c1_loop;
							CLOSE c1;
							/*Ingreso de los dias de semana*/
							
SET fecha=(ADDDATE(fecha,1)); #Suma un dia a la fecha actual
SET done=FALSE; #Reasigna la bandera a FALSE para poder volver a condicionar la salida del cursor

END WHILE;
set bandera =1;
select bandera;



END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for cambiar_clave
-- ----------------------------
DROP PROCEDURE IF EXISTS `cambiar_clave`;
delimiter ;;
CREATE PROCEDURE `cambiar_clave`(pid_usuario VARCHAR(100), pclave VARCHAR(150))
BEGIN
	DECLARE bandera INT;
	SET bandera=0;
		IF EXISTS(SELECT id_usuario FROM usuarios WHERE id_usuario=pid_usuario)THEN
			UPDATE usuarios SET clave=pclave WHERE id_usuario=pid_usuario;
			SET bandera=1;
		END IF;
	SELECT bandera;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for consultar_fechas_calendario
-- ----------------------------
DROP PROCEDURE IF EXISTS `consultar_fechas_calendario`;
delimiter ;;
CREATE PROCEDURE `consultar_fechas_calendario`(pprimer_dia DATE,pultimo_dia DATE)
BEGIN


	#Subquery 1
	SELECT fechas2.fecha as 'start',COUNT(citas.id_cita) as numeroCitas,fechas2.numero_cupos_asignados as numeroCupos, fechas2.nombre_festivo as nombreFestivo FROM citas 
	#INNER JOIN
	 RIGHT JOIN
	(SELECT fechas.id_fecha,fechas.fecha, SUM(fechas.numero_cupos) as numero_cupos_asignados ,fechas.nombre_festivo #Subquery 2
	FROM fechas WHERE estado=1
	GROUP BY fechas.fecha) as fechas2
	ON fechas2.id_fecha=citas.id_fecha WHERE fechas2.fecha BETWEEN pprimer_dia AND pultimo_dia
	GROUP BY fechas2.fecha;

END
;;
delimiter ;

