delimiter ;;
CREATE PROCEDURE `crear_dia_festivo`(pfecha DATE,
pnombre_festivo VARCHAR(100))
BEGIN

	DECLARE estado INT DEFAULT 0;

   	IF EXISTS(SELECT * FROM fechas WHERE fecha=pfecha)THEN
				IF EXISTS(SELECT * FROM fechas INNER JOIN citas ON fechas.id_fecha= citas.id_fecha WHERE fechas.fecha=pfecha)THEN
							SET estado=3;
						ELSE 
							DELETE FROM fechas WHERE fecha=pfecha;						

							#AGREGAR CURSOR PARA INGRESAR DIAS Y HORAS ACORDE A HORARIOA DE TIPO FIN DE SEMANA 
				END IF;
		END IF;

		

END
;;
