-- ----------------------------
-- Procedure structure for crud_cita
-- ----------------------------
DROP PROCEDURE IF EXISTS `crud_cita`;
delimiter ;;
CREATE PROCEDURE `crud_cita`(indice INT, pid_cita INT , pid_donante INT , pid_fecha INT , pid_usuario VARCHAR(100))
BEGIN


	DECLARE nid VARCHAR(100);
	DECLARE contador INT;
	DECLARE estado INT DEFAULT 0;


	IF(indice=1)THEN

		#Si no hay registros en la tabla 
		IF((select count(*) from citas)= 0)THEN		
			SET contador=(SELECT COUNT(id_cita)+1 FROM CITAS);		
			ELSE 
			SET contador=(SELECT MAX(id_cita)+1 FROM citas);
		END IF;

		IF(contador<10)THEN
			SET nid=(SELECT CONCAT('00000',contador));
		END IF;
		IF(contador>=10 AND contador<100)THEN
			SET nid=(SELECT CONCAT('0000',contador));
		END IF;
	  IF(contador>=100 AND contador<1000)THEN
			SET nid=(SELECT CONCAT('000',contador));
		END IF;
		IF(contador>=1000 AND contador<10000)THEN
			SET nid=(SELECT CONCAT('00',contador));
		END IF;
		IF(contador>=10000 AND contador<10000)THEN
			SET nid=(SELECT CONCAT('00',contador));
		END IF;
		IF(contador>=100000 AND contador<100000)THEN
			SET nid=(SELECT CONCAT('0',contador));
		END IF;

		SET estado=1;

	END IF;
	
	IF(indice=2)THEN

		UPDATE citas SET id_fecha=pid_fecha WHERE id_cita=pid_cita;
		SET estado=1;

	END IF;
	


	SELECT estado;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for crud_donantes
-- ----------------------------
DROP PROCEDURE IF EXISTS `crud_donantes`;
delimiter ;;
CREATE PROCEDURE `crud_donantes`(indice INT,
pid_donante INT, 
pdui VARCHAR(10), 
pid_paciente INT , 
ptelefono1 VARCHAR(9) ,
ptelefono2 VARCHAR(9),
pnombre VARCHAR(250))
BEGIN
		

	DECLARE estado INT DEFAULT 0;
	DECLARE contador INT;
	DECLARE niddonante VARCHAR(100);

	IF(indice=1)THEN

			IF((SELECT COUNT(*) FROM donantes)=0)THEN
						SET contador=(SELECT COUNT(*)+1 FROM donantes);				
					ELSE 				
						SET contador=(SELECT MAX(id_donante)+1 FROM donantes);
			END IF;


		IF(contador<10)THEN
		
				SET niddonante=(SELECT CONCAT('00000',contador));

			
				ELSEIF(contador>=10 AND contador<100)THEN					
					SET niddonante=(SELECT CONCAT('0000',contador));
				
				ELSEIF(contador>=100 AND contador<1000)THEN					
					SET niddonante=(SELECT CONCAT('000',contador));
	
				ELSEIF(contador>=1000 AND contador<10000)THEN					
					SET niddonante=(SELECT CONCAT('00',contador));
				
				ELSEIF(contador>=10000 AND contador<100000)THEN					
					SET niddonante=(SELECT CONCAT('0',contador));								
		END IF;
		


		VALUES 	(niddonante,pdui,pid_paciente,ptelefono1,ptelefono2,pnombre);

		SET estado=1;
		
		SELECT niddonante;


	END IF;


	IF(indice=2)THEN


			UPDATE donantes SET nombre=pnombre, telefono1=ptelefono1, telefono2=ptelefono2 , id_paciente=pid_paciente, dui=pdui
			WHERE id_donante=pid_donante;

			SET estado=1;

SELECT estado;
	
	END IF;

	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for crud_pacientes
-- ----------------------------
DROP PROCEDURE IF EXISTS `crud_pacientes`;
delimiter ;;
CREATE PROCEDURE `crud_pacientes`(indice INT,
pid_paciente INT,
pnombres VARCHAR(125),
papellidos VARCHAR(100),
pdui VARCHAR(10),
pafiliacion VARCHAR(12),
pprocedencia VARCHAR(100))
BEGIN

	DECLARE estado INT DEFAULT 0;
	DECLARE nidpaciente VARCHAR(100);
	DECLARE contador INT;

	IF(indice=1)THEN
	
			IF((SELECT COUNT(*) FROM pacientes)=0)THEN
					SET contador=(SELECT COUNT(*)+1 FROM pacientes);
				ELSE 				
					SET contador=(SELECT MAX(id_paciente)+1 FROM pacientes);
			END IF;

			IF(contador<10)THEN	
						SET nidpaciente=(SELECT CONCAT('0000',contador));			
					ELSEIF(contador>=10 AND contador<100)THEN
						SET nidpaciente=(SELECT CONCAT('000',contador));
					ELSEIF(contador>=100 AND contador<1000)THEN
						SET nidpaciente=(SELECT CONCAT('00',contador));
					ELSEIF(contador>=10000 AND contador<100000)THEN
						SET nidpaciente=(SELECT CONCAT('0',contador));
					ELSEIF(contador>=100000 AND contador<1000000)THEN
						SET nidpaciente=(SELECT contador);
			END IF;


			select nidpaciente;
	

	END IF;


	IF(indice=2)THEN


		UPDATE pacientes 
		SET nombres=pnombres,
				apellidos=papellidos,
				dui=pdui,
				afiliacion=pafiliacion,
				procedencia=pprocedencia
		WHERE id_paciente=pid_paciente;

		SET estado=1;
		SELECT estado;
	
	END IF;
	

	

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for crud_usuarios
-- ----------------------------
DROP PROCEDURE IF EXISTS `crud_usuarios`;
delimiter ;;
CREATE PROCEDURE `crud_usuarios`(indice int ,pid_usuario varchar(100), pid_tipo_usuario varchar(100),pusuario varchar(12),pclave varchar(150),pnombres varchar(150), papellidos varchar(150), pestado int)
BEGIN

	DECLARE bandera INT;
	DECLARE cuenta  INT;
	DECLARE nuevo_id VARCHAR(100);
	SET bandera=0;

	SET cuenta=(SELECT MAX(id_usuario)+1 FROM usuarios);
	
	IF(indice=1)THEN

			IF(cuenta<10)THEN
				SET nuevo_id=(SELECT CONCAT('00000',cuenta));
			END IF;
			IF(cuenta>=10 AND cuenta<100)THEN
				SET nuevo_id=(SELECT CONCAT('0000',cuenta));
			END IF;
			IF(cuenta>=100 AND cuenta<1000)THEN
				SET nuevo_id=(SELECT CONCAT('000',cuenta));
			END IF;
			IF(cuenta>=1000 AND cuenta<10000)THEN
				SET nuevo_id=(SELECT CONCAT('00',cuenta));
			END IF;
			
			IF NOT EXISTS( SELECT * FROM usuarios WHERE usuario=pusuario)THEN
				VALUES (nuevo_id, pid_tipo_usuario, pusuario, pclave, pnombres, papellidos,  pestado);
				SET bandera=1;
			ELSE
				SET bandera=0;
			END IF;		

	END IF;
	IF(indice=2)THEN

			UPDATE usuarios SET  id_tipo_usuario=pid_tipo_usuario, usuario=pusuario, nombres=pnombres , apellidos=papellidos,
			estado=pestado WHERE id_usuario=pid_usuario;

		SET bandera=1;

	END IF;

	SELECT bandera;

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for disponibles
-- ----------------------------
DROP PROCEDURE IF EXISTS `disponibles`;
delimiter ;;
CREATE PROCEDURE `disponibles`()
BEGIN

select ((select sum(numero_cupos) from fechas where fecha=curdate() and estado=1) - count(citas.id_cita)) as cupos_disponibles from citas INNER JOIN fechas on citas.id_fecha=fechas.id_fecha WHERE fechas.fecha=curdate();

END
;;
delimiter ;

