-- ----------------------------
-- Procedure structure for obtener_horarios_habiles_fecha
-- ----------------------------
DROP PROCEDURE IF EXISTS `obtener_horarios_habiles_fecha`;
delimiter ;;
CREATE PROCEDURE `obtener_horarios_habiles_fecha`(pfecha DATE)
BEGIN

SELECT fechas.id_fecha,COUNT(citas.id_cita) as "citas" , fechas.numero_cupos , 
(fechas.numero_cupos - COUNT(citas.id_cita)) as "cupos_disponibles"  ,
fechas.id_fecha, fechas.horario 
FROM citas 
RIGHT JOIN fechas 
ON citas.id_fecha=fechas.id_fecha
WHERE fechas.fecha=pfecha 
AND fechas.estado=1 
GROUP BY fechas.id_fecha;

END
;;
delimiter ;

